        <div>
            {
                allRecipes.map(r =>(
                    <ul key={r.id}>
                        {/* <p>{r.name}</p>
                        <p>{r.image}</p> */}
                       <li>{r.diets}</li>
                    </ul>
                ))
            }

        </div>
    )
}

export default Recipe;
